import React from 'react';

const ChapterApplicationForm = () => {
  return (
    <div>
      <iframe
        src="https://tally.so/embed/mOPMR7?alignLeft=1&hideTitle=1&transparentBackground=1&dynamicHeight=1"
        width="100%"
        height="600"
        frameBorder="0"
        scrolling="no"
        allowFullScreen
      ></iframe>
    </div>
  );
}

export default ChapterApplicationForm;
